import React from 'react';
import { Route, Switch, withRouter } from 'react-router-dom';
import { Showcase } from '../showcase/Showcase';
import Login from '../login/Login';
import NoMatch from '../error/NoMatch';
import Outer from '../product/outer/Test1';
import { connect } from 'react-redux';
import { Dispatch } from 'redux';


const PublicRoute: React.FC<any> = ({ component: CustomComponent, loading, isLogged, ...res }) => {
    if (loading) {
        return (<div>loading</div>);
    }
    if (isLogged) {
        return (<div>isLogged</div>);
    }
    const renderCustomComponet = (props: any) => <CustomComponent {...props} />;
    return (<Route {...res} render={renderCustomComponet} />);
};

const PrivateRoute: React.FC<any> = ({ component: CustomComponent, loading, isLogged, ...res }) => {
    if (loading) {
        return (<div>loading</div>);
    }
    if (isLogged) {
        return (<div>isLogged</div>);
    }
    const renderCustomComponet = (props: any) => <CustomComponent {...props} />;
    return (<Route {...res} render={renderCustomComponet} />);
};

export class LayoutComponent extends React.Component {
    public state = {};
    public render() {
        return (
            <div>
                <Switch>
                    <PublicRoute path="/test" component={Outer} />
                    <PrivateRoute path="/login" component={Login} />
                    <Route exact={true} path="/" component={Outer} />
                    <Route exact={true} path="/:category" component={Showcase} />
                    <Route component={NoMatch} />
                </Switch>
                {/* <Footer /> */}
            </div>
        );
    }
}

const mapStateToProps = (state: any) => ({

});

const mapDispatchToProps = (dispatch: Dispatch<any>) => ({

});

export const Layout = withRouter(connect(mapStateToProps, mapDispatchToProps)(LayoutComponent));
